import React from 'react';
import './Home.css';  // import stylów

const Home = () => {
  return (
    <div className="container">
      <h1>Witaj w Schronisku Przytulisko</h1>
      <p>
        Tutaj możesz poznać naszych podopiecznych, umówić się na spotkanie lub wspomóc naszą działalność.
      </p>

      <div className="button-group">
        <button>Poznaj podopiecznych</button>
        <button>Umów się na spotkanie</button>
        <button>Wesprzyj nas</button>
      </div>
    </div>
  );
};

export default Home;
